import React from "react";

const GreatOperationButton = ({ setResult }) => {
	const handlerClick = (e) => {};
	return (
		<div className="GreatOperationButton">
			<button value="+" onClick={handlerClick}>
				+
			</button>
			<button value="-" onClick={handlerClick}>
				-
			</button>
			<button value="*" onClick={handlerClick}>
				*
			</button>
			<button value="/" onClick={handlerClick}>
				/
			</button>
			<button value="." onClick={handlerClick}>
				.
			</button>
		</div>
	);
};

export default GreatOperationButton;
